DROP TABLE IF EXISTS `mst_vehicle`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `mst_vehicle` (
  `vehicle_no` varchar(20) NOT NULL COMMENT 'Vehicle No',
  `vehicle_status` tinyint(1) NOT NULL COMMENT 'Vehicle Status',
  `plant_id` int(10) DEFAULT NULL COMMENT 'Plant Id',
  `plant_name` varchar(45) DEFAULT NULL,
  `company_id` int(10) NOT NULL COMMENT 'Company Id',
  `vehicle_make` varchar(30) DEFAULT NULL COMMENT 'Vehicle Make',
  `vehicle_model` varchar(20) DEFAULT NULL COMMENT 'Vehicle Model',
  `vehicle_model_no` varchar(45) DEFAULT NULL COMMENT 'Vehicle Model Number',
  `veh_manufactured_year` varchar(20) DEFAULT NULL COMMENT 'Vehicle Manufacturer year',
  `vehicle_type` varchar(20) DEFAULT NULL COMMENT 'Vehicle Type',
  `vehicle_body_type` varchar(30) DEFAULT NULL COMMENT 'Vehicle Body Type',
  `vehicle_floor_type` varchar(30) DEFAULT NULL COMMENT 'Vehicle Floor Type',
  `no_of_wheels` int(10) DEFAULT NULL COMMENT 'Number of Wheels',
  `fuel_type` varchar(25) DEFAULT NULL COMMENT 'Fuel Type',
  `max_carry_capacity` int(10) DEFAULT NULL COMMENT 'Maximum Capacity in tons',
  `optimal_carry_capacity` int(10) DEFAULT NULL COMMENT 'Optimal Carrying Capacity in tons',
  `gross_weight` varchar(30) DEFAULT NULL COMMENT 'Gross Weight in tons',
  `unladen_weight` varchar(30) DEFAULT NULL COMMENT 'Unladen Weight ',
  `vehicle_orgin` varchar(45) DEFAULT NULL COMMENT 'Vehicle Orgin Place',
  `vehicle_length` int(10) DEFAULT NULL COMMENT 'vehicle Length',
  `vehicle_height` int(10) DEFAULT NULL COMMENT 'Vehicle Height',
  `vehicle_width` int(10) DEFAULT NULL COMMENT 'Vehicle Width',
  `engine_no` varchar(40) DEFAULT NULL COMMENT 'Engine No',
  `chasis_no` varchar(25) DEFAULT NULL COMMENT 'Chasis No',
  `transporter_id` varchar(50) DEFAULT NULL COMMENT 'Transporter Id',
  `transporter_name` varchar(50) DEFAULT NULL COMMENT 'Transporter Name',
  `driver_id` int(10) DEFAULT NULL COMMENT 'Driver Id',
  `driver_name` varchar(40) DEFAULT NULL COMMENT 'Driver Name',
  `primary_owner_name` varchar(35) DEFAULT NULL COMMENT 'primary Owner Name',
  `primary_owner_mobile_no` varchar(10) DEFAULT NULL COMMENT 'Primary Owner Contact No',
  `secondary_owner_name` varchar(35) DEFAULT NULL COMMENT 'Secondary Owner Name',
  `secondary_owner_mobile_no` varchar(10) DEFAULT NULL COMMENT 'Secondary Owner Contact No',
  `vehicle_rc_no` varchar(45) DEFAULT NULL COMMENT 'Vehicle RC Number',
  `insurance_no` varchar(40) DEFAULT NULL COMMENT 'Insurance No',
  `insurance_company_name` varchar(40) DEFAULT NULL COMMENT 'Insurance Company Name',
  `insurance_expiry_dt` date DEFAULT NULL COMMENT 'Insurance Expiry Date',
  `road_tax_renewal_dt` date DEFAULT NULL COMMENT 'Road Tax Renewal Date',
  `fitness_renewal_dt` date DEFAULT NULL COMMENT 'Fitness Renewal Date',
  `goods_pemit_validity_dt` date DEFAULT NULL COMMENT 'Goods Permit Validity Date',
  `hazardous_material_license` varchar(10) DEFAULT NULL COMMENT 'Hazardous Material License',
  `pvc_issued_dt` date DEFAULT NULL COMMENT 'PVC Issued Date',
  `pvc_validity_dt` date DEFAULT NULL COMMENT 'PVC Validity Date',
  `puc_issued_dt` date DEFAULT NULL COMMENT 'PUC Issued Date',
  `puc_validity_dt` date DEFAULT NULL COMMENT 'PUC Validity Date',
  `preffered_destination` varchar(20) DEFAULT NULL COMMENT 'Preffered Destinations',
  `created_dt` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'Created Date',
  `modified_dt` datetime DEFAULT NULL COMMENT 'Modified Date',
  `modified_by` int(10) DEFAULT NULL COMMENT 'Modified User',
  PRIMARY KEY (`vehicle_no`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

