INSERT INTO `req_versions` VALUES (17,1,1,'\n<p>Login services should include below functionalities:</p>\n\n<p>1. User Login</p>\n\n<p>2. Login Recovery</p>\n\n<p>3. Reset Password</p>\n','D','3',1,0,39,1,'2019-07-22 01:07:03',NULL,'2019-07-22 10:07:03','Requirement Created'),(19,1,1,'\n<p>User Management requirement includes below functionalities:</p>\n\n<p>1. Add User</p>\n\n<p>2. Edit User</p>\n\n<p>3. List User</p>\n\n<p>4. Roles</p>\n\n<p>5. Privileges</p>\n\n<p>6. Roles - Privileges mapping</p>\n','D','3',1,0,50,1,'2019-07-22 01:07:03',NULL,'2019-07-22 10:07:03','Requirement Created'),(933,1,1,'<p>Device Management should define below functionalities:</p>\r\n\r\n<p>1. Sim Configuration</p>\r\n\r\n<p>2. Add Device</p>\r\n\r\n<p>3. View Device</p>\r\n\r\n<p>4. Device Inventory Report</p>','D','3',1,0,40,2,'2019-08-06 11:54:25',NULL,'2019-08-06 11:54:25','Requirement Created'),(958,1,1,'<p>User Login</p>\r\n\r\n<p>Password Reset</p>','D','3',1,1,10,2,'2019-08-14 10:06:30',NULL,'2019-08-14 10:06:30','Requirement Created'),(1751,1,1,'<p>Validation on Signal Receiver and Enricher</p>','D','3',1,1,6,2,'2019-11-24 23:23:45',NULL,'2019-11-25 10:23:45','Requirement Created');
