INSERT INTO `tcsteps` VALUES (131,1,'<p>Launch autoplant TaT application using &#39;url&#39; in any of the browser.</p>\n','<p>User should be able to launch application successfully.</p>\n',1,1),(134,1,'<p>Launch autoplant TaT application using &#39;url&#39;</p>\n','<p>user should be able to launch application successfully</p>\n',1,1),(135,2,'<p>check for the background image.</p>\n','<p>background image should be as per the requirement</p>\n',1,1),(136,3,'<p>Check for the below mentioned fields on the screen:</p>\n\n<p>1. Autoplant logo</p>\n\n<p>2. &#39;Log in to your account&#39;</p>\n\n<p>3. User ID</p>\n\n<p>4. Password&nbsp;</p>\n\n<p>5. Login</p>\n\n<p>6. OR</p>\n\n<p>7. Login with Google</p>\n\n<p>8. Can&#39;t log in?</p>\n\n<p>9. Sign up for an account</p>\n\n<p>&nbsp;</p>\n','<p>All the mentioned fields should be available.</p>\n\n<p>1.&nbsp;Autoplant logo placed on the top middle of the frame.</p>\n\n<p>2. Log in to your account label - not editable</p>\n\n<p>3. &#39;UserId&#39; input box</p>\n\n<p>4. &#39;Password&#39; input box with eye icon</p>\n\n<p>5. &#39;Login&#39; button - clickable</p>\n\n<p>6. &#39;OR&#39; label - not editable</p>\n\n<p>7. &#39;Login with Google&#39; button -clickable with google icon in the beginning.</p>\n\n<p>8. &#39;Can&#39;t log in?&#39; hyperlink - clickable</p>\n\n<p>9. &#39;Sign up for an account&#39; hyperlink - clickable</p>\n',1,1),(139,1,'<p>On the login screen, navigate to UserId field</p>\n','<p>User should be able to navigate to UserId field.</p>\n',1,1),(140,2,'<p>Give vaild email Id format input.</p>\n','<p>User should be able to input valid email Id.&nbsp;</p>\n',1,1),(141,3,'<p>Input password in password field</p>\n','<p>User should be able to input password.</p>\n',1,1),(142,4,'<p>Click on Login button.</p>\n','<p>User should be able to login sucessfully into the application.</p>\n\n<p>&nbsp;</p>\n',1,1),(145,1,'<p>On the login screen, navigate to UserId field</p>\n','<p>User should be able to navigate to UserId field.</p>\n',1,1),(146,2,'<p>Enter valid&nbsp;UserId (valid email Id format)</p>\n','<p>UserId field should accept valid emailId and allow to navigate to next field without any error messages.</p>\n\n<p>Password field should be enabled.</p>\n',1,1),(147,3,'<p>Input password in text box</p>\n','<p>Entered text should be invisible/mask.</p>\n',1,1),(148,4,'<p>Enter a valid password.</p>\n','<p>User should be able to enter password.</p>\n',1,1),(149,5,'<p>Click on Login button</p>\n','<p>User should be able to login into application with valid password format.</p>\n',1,1),(152,1,'<p>On the login screen, navigate to UserId field</p>\n','<p>User should be able to navigate to UserId field.</p>\n',1,1),(153,2,'<p>Enter valid UserId (valid email Id format)</p>\n','<p>UserId field should accept valid emailId and allow to navigate to next field without any error messages.</p>\n',1,1),(154,3,'<p>Input only alphabetics (invalid format) in password field.</p>\n','<p>User should not be allowed to login into application .</p>\n\n<p>An error message &#39;Enter atleast 1 numeric value&#39;.&nbsp; should be displayed.</p>\n',1,1),(155,4,'<p>Input only numeric value in password field.</p>\n','<p>User should not be allowed to login into application.</p>\n\n<p>An error message &#39;Enter atleast 1 special character&#39;&nbsp;should be displayed.</p>\n',1,1),(156,5,'<p>Input only special characters in password field.</p>\n','<p>User should not be allowed to login into application.</p>\n\n<p>An error message &#39;Password should be alphanumeric&#39; should be displayed.</p>\n',1,1),(157,6,'<p>1. Input alphanumeric value in password field.</p>\n','<p>User should not be allowed to login into application.</p>\n\n<p>An error message &#39;Enter atleast 1 special character&#39; sould be displayed.</p>\n',1,1),(158,7,'<p>&nbsp;Input only alphabetics and special characters.</p>\n','<p>User should not be allowed to login into application.</p>\n\n<p>An error message &#39;Enter alteast one number&#39;should be displayed.</p>\n',1,1),(159,8,'<p>1. Input only numbers and spcial characters.</p>\n','<p>User should not be allowed to login into application.</p>\n\n<p>An error message &#39;Enter atleast 1 alphabetics&#39;&nbsp;should be displayed.</p>\n',1,1),(160,9,'<p>Input a password with combination of alphabetics, numbers and special character which should be less than 8 characters.</p>\n\n<p>&nbsp;</p>\n','<p>User should not be allowed to login into application.</p>\n\n<p>An error message &#39;Password should be minimum 8 characters&#39; should be displayed.</p>\n',1,1),(164,1,'<p>Launch autoplant TaT application using &#39;url&#39; in any of the browser.</p>\n','<p>User should be able to launch application successfully.</p>\n',1,1),(165,2,'<p>Navigate to Can&#39;t Login? hyper link</p>\n','<p>Link shoud be clickable.</p>\n\n<p>On clicking the link, user hould be redirect to Login - Recovery page and it should open in new tab.</p>\n',1,1),(168,1,'<p>check for the background image.</p>\n','<p>background image should be as per the requirement</p>\n',1,1),(169,2,'<p>Check for the below mentioned fields on the screen:</p>\n\n<p>1. Autoplant Logo.</p>\n\n<p>2. Can&#39;t Login?</p>\n\n<p>3. We&#39;ll send a recovery link to</p>\n\n<p>4. Email ID text box</p>\n\n<p>5. Send Recovery link button.</p>\n\n<p>6. Return to login</p>\n\n<p>7. Help</p>\n','<p>1. Autoplant logo placed on the top middle of the frame.</p>\n\n<p>2. &#39;Can&#39;t Login?&#39; label - not editable</p>\n\n<p>3. &#39;We&#39;ll send a recovery link to&#39; label - not editable</p>\n\n<p>4. Email ID text box - Editable</p>\n\n<p>5. Send Recovery link button. - Clickable</p>\n\n<p>6. &#39;Return to login&#39; link - Clickable</p>\n\n<p>7. &#39;Help&#39; - Clickable</p>\n',1,1),(172,1,'<p>On the login recovery screen, navigate to EmailId/UserId field</p>\n','<p>User should be able to navigate to UserId field.</p>\n',1,1),(173,2,'<p>Give vaild email Id format input.</p>\n','<p>User should be able to 