nerated as per the following columns</p>\r\n\r\n<p>Sr No<br />\r\nTrip Id - As per the trip report<br />\r\nVehicle - As per the Trip Report<br />\r\nDevice - As per the trip report<br />\r\nTransporter Name - As Per the Trip Report<br />\r\nMines Name - As Per the Trip Report<br />\r\nTP Number - As per the trip report<br />\r\nTrip Status - As per the trip report<br />\r\nStart Time - &nbsp;<br />\r\nEnd Time -&nbsp;<br />\r\nIdle duration(Days hh:mm:ss) -&nbsp;<br />\r\nStart Location - Start location of the idle time as per the real time<br />\r\nEnd Location - End location of the idle time as per the real time</p>\r\n\r\n<p><br />\r\nNote: the idling time data should be reflect from trip start time to plant entry time</p>\r\n',1,1),(992,3,'<p>Need to verify the if the speed &nbsp;&gt; 0 then the idling details for the vehicle is displayed or not</p>\r\n','<p>If the Speed is &gt; 0 and &lt; 10 kmph then the vehicle idling details should be displayed &nbsp;</p>\r\n\r\n<p>Note: Kindly confirm this scenario if the vehielc is in the idling and the some how its start the vehicle to adjust the space in parking &nbsp;mode then the details should be reflect or not&nbsp;</p>\r\n',1,1),(993,4,'','',1,1),(1015,2,'','',1,1),(1018,1,'<p>To verify that If user is logged in e-Check &amp; i-Track mobile app, then these all login details are display in Application usage report</p>\r\n','<p>1. If user is logged in e-Check &amp; i-Track mobile app, then these all login details should display in Application usage report.<br />\r\n2. Below data should check in Application usage report<br />\r\nLog in creation data and time, logout date and time,&nbsp; last login date and time with IP address.</p>\r\n',1,1),(1022,1,'<p>To verify that Trip report and Order status report in Download module</p>\r\n','<p>Trip report and Order status report should be available in Download module for vedanta_coal login.</p>\r\n',1,1),(1025,1,'<p>To verify that Map option available for below&nbsp; Dashboard