te/Time<br />\r\nEnd Date/Time<br />\r\nViolation Duration<br />\r\nFrom Location<br />\r\nTo Location</p>\r\n\r\n<p><strong>Note:</strong> &nbsp;the data should captured if vehicle speed exceeds &gt; 20KMPH inside the plant when 5 consecutive strings. The start time should take when vehicle exceeds speed limit and end time should take when vehicle deceed speed limit&nbsp;</p>\r\n',1,1),(1109,2,'<p>Need to verify the all generated data for the Speed violation report</p>\r\n','<p>the Report should be generated as per the following column&nbsp;</p>\r\n\r\n<p>Trip ID - same as trip report<br />\r\nVehicle No - Same asTrip Report<br />\r\nTransporter Name - Same as Trip report<br />\r\nTP No - From Integration&nbsp;<br />\r\nTP Date/Time - Same as trip report&nbsp;<br />\r\nSource - The Trip start location<br />\r\nDestination - The trip end location<br />\r\nStart Speed - start speed of the vehicle<br />\r\nEnd Speed &nbsp;- End speed of the vehicle<br />\r\nStart Date/Time - violation started date and time&nbsp;<br />\r\nEnd Date/Time - violation ended date and time<br />\r\nViolation Duration - difference between end and start time<br />\r\nFrom Location - Starting location of vehicle for violation<br />\r\nTo Location - End location of the vehicle for the Violation</p>\r\n\r\n<p><strong>Note:</strong>&nbsp;The Data sould be reflect only if the in the plant speed of the vehicle is &gt; 20 with the 5 consecutive strings</p>\r\n',1,1),(1112,1,'<p>Need to check whether the Idling report displeyd or not as per the given column format</p>\r\n','<p>The Report should be generated as per the following columns</p>\r\n\r\n<p>Trip ID<br />\r\nVehicle No<br />\r\nTransporter Name<br />\r\nTP No<br />\r\nTP Date/Time<br />\r\nSource<br />\r\nDestination<br />\r\nIdle Start Time<br />\r\nIdle End Time<br />\r\nIdle Duration<br />\r\nIdling Location<br />\r\nStage&nbsp;</p>\r\n\r\n<p>Note: the idling time data should be reflect from trip start time to plant entry time and the to capture the idle time, duration is 10 mins</p>\r\n',1,1),(1113,2,'<p>Need to verify tha all generated data for the Idle time Report</p>\r\n','<p>The Report should be generated as per the following columns</p>\r\n\r\n<p>Trip ID - Same as trip report<br />\r\nVehicle No - Same as trip report<br />\r\nTransporter Name - same as Trip report<br />\r\nTP No - Same the trip report<br />\r\nTP Date/Time - same as trip Report<br />\r\nSource - Same as trip report<br />\r\nDestination - Same as trip report<br />\r\nIdle Start Time - The start time for idling<br />\r\nIdle End Time - The end time for idling<br />\r\nIdle Duration - difference between start time and end time<br />\r\nIdling Location - Location where the idling was captured<br />\r\nStage - Show &ldquo;En-route&rdquo; (if vehicle is outside plant premises), Plant Stages Name: Yard, Weigh-bridge, Unloading, Sampling, Gate In, Coal Yard</p>\r\n\r\n<p>Note: the idling time data should be reflect from trip start time to plant entry time and the to capture the idle time, duration is 10 mins</p>\r\n',1,1),(1116,1,'<p>need to verify the whether the hyperlink is provided or not in &nbsp;the target destination column</p>\r\n','<p>The Hyperlink should be displayed for the specified column like -&nbsp;<br />\r\n1. Target No of Destination 1&nbsp;<br />\r\n2. Target No of Destination 2&nbsp;<br />\r\n3. Target No of Perement Destination</p>\r\n',1,1),(1117,2,'<p>Need to verify that whether the Hyperlink for the specified columns</p>\r\n','<p>The hyperlink should display following specified columns :&nbsp;</p>\r\n\r\n<p>SrNo<br />\r\nTrip id</p>\r\n\r\n<p>Destination Name</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>For example if the 8 destination are there in the single trip then the all destination names should be displayed against the trip id</p>\r\n',1,1),(1118,3,'<p>Need to verify that whether the destinantion column values displayed or not as per the VRS Name</p>\r\n','<p>The destination name should be displayed as per the VRS na