\r\n\r\n<p>3. last Date/Time - the last communication date and time</p>\r\n\r\n<p>4. Current Status - The current status of the device Like FAulty, Intransit, Inventory, Tracking, Lost</p>\r\n\r\n<p>5. Action Taken - The loction where status of the device is updated</p>\r\n\r\n<p>6. Location - The location at which the action is takes place</p>\r\n\r\n<p>7. Remarks - the remarks updated by user</p>\r\n\r\n<p>8. Updated By - The name of the user who is updating the status</p>\r\n\r\n<p>9. Update Date/Time - the date and time when the device status is updated / autofetched from the&nbsp; system date and time</p>\r\n\r\n<p>10. Update Status - button shjould be availabe. after clicking on the button the pop up should be generated</p>\r\n\r\n<p>The total&nbsp;count should be generated after the refresh innterval or after updating the status of the device</p>\r\n\r\n<p><em><strong>Faulty: &nbsp;In-transit: Inventory: &nbsp;Tracking:&nbsp;&nbsp;Lost:&nbsp; Total:&nbsp;</strong></em></p>\r\n',1,1),(1221,5,'<p>Chedck the update button popup</p>\r\n\r\n<p>&nbsp;</p>\r\n','<p>The update button popup should be displayed the following fields</p>\r\n\r\n<p>Device no:</p>\r\n\r\n<p>current Status:</p>\r\n\r\n<p>Changed Status:</p>\r\n\r\n<p>Action taken:</p>\r\n\r\n<p>Select Plant:</p>\r\n\r\n<p>Remarks:</p>\r\n\r\n<p>Handeled By:</p>\r\n\r\n<p>&nbsp;</p>\r\n',1,1),(1222,6,'<p>Check&nbsp;the data fields for the update button</p>\r\n','<p>The following details should be reflected after updating the device status:</p>\r\n\r\n<p><strong>Device no:</strong> same no for which the data&nbsp;is going to be update</p>\r\n\r\n<p><strong>current Status:</strong> the current status of the device&nbsp;</p>\r\n\r\n<p><strong>Changed Status:&nbsp;&nbsp;</strong></p>\r\n\r\n<p>&nbsp;<strong>Action taken: </strong>the follwing action should be taken&nbsp; against the device status</p>\r\n\r\n<p>If the current status is <strong>FAULTY </strong>then Following action&nbsp;</p>\r\n\r\n<p>a. Send to office</p>\r\n\r\n<p>b. comformation awaited</p>\r\n\r\n<p>c. Non-repairable</p>\r\n\r\n<p>If the status is <strong>In-transit</strong> then following action should&nbsp;be available</p>\r\n\r\n<p>a. Mines to plant</p>\r\n\r\n<p>b. plant To mines</p>\r\n\r\n<p>If the Status is <strong>Inventory&nbsp;</strong>then he following action should be available</p>\r\n\r\n<p>a. At Plant</p>\r\n\r\n<p>b. At challan office</p>\r\n\r\n<p>c. At Office</p>\r\n\r\n<p>If the Status is&nbsp;<strong>Tracking&nbsp;</strong>&nbsp;then Installed in vehicle action should be available</p>\r\n\r\n<p>If the Status is&nbsp;<strong>Lost&nbsp;</strong>&nbsp;then the Escalated action shoud bbe avilable.</p>\r\n\r\n<p><strong>Select Plant:&nbsp;</strong>The Plant name list should be available</p>\r\n\r\n<p><strong>Remarks:&nbsp;</strong>Text Box should be avilable</p>\r\n\r\n<p><strong>Handeled By: </strong>The User name who is upadating the status</p>\r\n\r\n<p><strong>Note: The Changed Status, Action Taken and Select Plant are mandatory fields. If User dose not select all mentioned fields the it should not processed further.</strong></p>\r\n',1,1),(1223,7,'<p>Check&nbsp;the data after clicking on update button</p>\r\n','<p>After providing the data on the update popup all values fields should be reflect the same on the device status report</p>\r\n',1,1),(1224,8,'<p>Check the Count after updaing the device status</p>\r\n','<p>After updating the data for the devices count should be updated for status&nbsp;like</p>\r\n\r\n<p><em><strong>Faulty: </strong></em></p>\r\n\r\n<p><em><strong>In-transit:</strong></em></p>\r\n\r\n<p><em><strong>Inventory:&nbsp;&nbsp;</strong></em></p>\r\n\r\n<p><em><strong>Tracking:&nbsp; </strong></em></p>\r\n\r\n<p><em><strong>Lost:&nbsp; &nbsp;</strong></em></p>\r\n\r\n<p><em><strong>Total:&nbsp;</strong></em></p>\r\n',1,1),(1227,1,'<p>Check the reort is displayed or not in report selection tool</p>\r\n','<p>The Report should be available in the report selection tool</p>\r\n',1,1),(1228,2,'<p>Check whether the report is generated or not for the following columns:</p>\r\n\r\n<p>Transporter code</p>\r\n\r\n<p>Integration Transporter name</p>\r\n\r\n<p>Total Trips</p>\r\n\r\n<p>Monitored Trips</p>\r\n\r\n<p>Compliance status EARLY, HIT, LATE</p>\r\n','<p>The Following column should&nbsp;be displayed in the Delivery Compliance Report</p>\r\n\r\n<p>Transporter code</p>\r\n\r\n<p>Integration Transporter name</p>\r\n\r\n<p>Total Trips</p>\r\n\r\n<p>Monitored Trips</p>\r\n\r\n<p>Compliance status EARLY</p>\r\n\r\n<p>Compliance status&nbsp; HIT</p>\r\n\r\n<p>Compliance status&nbsp;LATE&nbsp;</p>\r\n',1,1),(1229,3,'<p>Check the data for the devilery compliance report</p>\r\n','<p>The Data should be generated for the following columns:</p>\r\n\r\n<p>Transporter code - The Transporter code should be displayed&nbsp;</p>\r\n\r\n<p>Integration Transporter name - Same transporter name shoud be displayed against the transporter code</p>\r\n\r\n<p>Total Trips - the all trip count should be displayed against transporter&nbsp;</p>\r\n\r\n<p>Monitored Trips - The total monitored trips count should be displayed</p>\r\n\r\n<p>Compliance status EARLY - total % for early status</p>\r\n\r\n<p>Compliance status&nbsp; HIT - Total % for the Hit status</p>\r\n\r\n<p>Compliance status&nbsp;LATE - Total % for the Late Status</p>\r\n',1,1),(1232,1,'<p>Need to verify the logic of&nbsp;trip report for SCW plant</p>\r\n','<p>We need to verify the logic for the Trip Report for SCW plant</p>\r\n',1,1),(1233,2,'<p>Need to verify that the whether the trip end location SCW plant or Not</p>\r\n','<p>The Trip end Location should be SWC plant&nbsp;</p>\r\n',1,1),(1234,3,'<p>Check the logic for the every field in the trip report</p>\r\n','<p>The Every field in the trip report the should satisfy the logic</p>\r\n',1,1),(1237,1,'<p>Check the following column were displayed or not in tye in-Plant Vehicle movement report</p>\r\n\r\n<p>1. Current Location&nbsp;</p>\r\n\r\n<p>2. Date/time</p>\r\n\r\n<p>3. Device Status</p>\r\n','<p>The following column should be displayed int the vehicle movement Report</p>\r\n\r\n<p>1. Current Location</p>\r\n\r\n<p>2. Date/Time</p>\r\n\r\n<p>3. Device Status</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Note: The Specified columns should be added at the end&nbsp; of the report</strong></p>\r\n',1,1),(1238,2,'<p>Check columns data as per the CSR report is displayed or not</p>\r\n','<p>The Same data should be reflect for the columns as per the CSR Report</p>\r\n',1,1),(1241,1,'<p>Check whether th red device bucket is displayed or not</p>\r\n','<p>The Red device bucket should be displayed on the dashboard</p>\r\n',1,1),(1242,2,'<p>Check the Red device bucket count is displayed or not</p>\r\n','<p>The Red device bucket count should be displayed</p>\r\n',1,1),(1243,3,'<p>Check whether the vehicle&#39;s data is displeyd or not after clicking on the vehicle count</p>\r\n','<p>The vehicle data should be reflected on the popup</p>\r\n',1,1),(1244,4,'<p>Check the vehicles priority&nbsp;</p>\r\n','<p>The vehicle Priority should be In RED</p>\r\n\r\n<p>i.e. if the&nbsp; vehicle fall under two buckets like red devices and customer site then the vehicle should be reflect inthe Red Devices bucket</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>NOTE: The RED devices priority should be high thanthe Other Buckets.</strong></p>\r\n',1,1),(1247,1,'<p>Check the email id&#39;s added or not for the speed violation alert</p>\r\n','<p>The email id&#39;s should be added for the Speed Violation alert</p>\r\n\r\n<p>Email id&#39;s:</p>\r\n\r\n<p>1.&nbsp; j<a href=\"mailto:jayashankar.s@adityabirla.com\" title=\"mailto:jayashankar.s@adityabirla.com\">ayashankar.s@adityabirla.com</a></p>\r\n\r\n<p>2.&nbsp;&nbsp;<a href=\"mailto:ramana.v@adityabirla.com\" title=\"mailto:ramana.v@adityabirla.com\">ramana.v@adityabirla.com</a></p>\r\n',1,1),(1248,2,'<p>Check the email&nbsp;id&#39;s added or not for the IDLE time vioaltion alert</p>\r\n','<p>The Email id should be added for the IDLE Time Alert</p>\r\n\r\n<p>Email Id&#39;s:</p>\r\n\r\n<p>1.&nbsp;&nbsp;<a href=\"mailto:jayashankar.s@adityabirla.com\" title=\"mailto:jayashankar.s@adityabirla.com\">jayashankar.s@adityabirla.com</a></p>\r\n\r\n<p>2.&nbsp;&nbsp;<a href=\"mailto:ramana.v@adityabirla.com\" title=\"mailto:ramana.v@adityabirla.com\">ramana.v@adityabirla.com</a></p>\r\n',1,1),(1249,3,'<p>Check whether&nbsp;the generated emails are only for the AP and Telengana location vehicles or not</p>\r\n\r\n<p>For&nbsp; Telengana<br />\r\nMIYAPUR-412<br />\r\nMEDCHAL-414<br />\r\nBOLLARAM-413<br />\r\nMANKHAL-416<br />\r\nBOLLARAM II-418</p>\r\n\r\n<p>For AP<br />\r\nVIZAG-I-481<br />\r\nVIJAYWADA-483<br />\r\nNELORE-485<br />\r\nVUZAG-II-486<br />\r\nGUNTUR-488<br />\r\nTIRUPATI-484<br />\r\nMANKHAL-416<br />\r\n&nbsp;</p>\r\n','<p>The Email should be generated for the AP and Telengana location Vehicles only&nbsp;</p>\r\n\r\n<p>Telengana<br />\r\nMIYAPUR-412<br />\r\nMEDCHAL-414<br />\r\nBOLLARAM-413<br />\r\nMANKHAL-416<br />\r\nBOLLARAM II-418</p>\r\n\r\n<p>AP<br />\r\nVIZAG-I-481<br />\r\nVIJAYWADA-483<br />\r\nNELORE-485<br />\r\nVUZAG-II-486<br />\r\nGUNTUR-488<br />\r\nTIRUPATI-484<br />\r\nMANKHAL-416<br />\r\n&nbsp;</p>\r\n',1,1),(1254,1,'<p>Check whether the Map Button is displayed or not in Trip Report SL</p>\r\n','<p>The map button should&nbsp; be displeyd in the Play back map</p>\r\n',1,1),(1255,2,'<p>Check whether the Playback map is working or not in the</p>\r\n','<p>The Play back map should be displaye.</p>\r\n\r\n<p>The Travelled route by the vehicle shoule be displayed in the playback map</p>\r\n',1,1),(1256,4,'<p>Check whether the table is displayed or not in the playback map with the following columns:</p>\r\n\r\n<p>Location</p>\r\n\r\n<p>Idle Duration</p>\r\n\r\n<p>Journey Type</p>\r\n\r\n<p>Distance From the Plant</p>\r\n\r\n<p>Click Here with Hyperlink&nbsp;</p>\r\n','<p>The Table should be displayed with the following columns:</p>\r\n\r\n<p>Location</p>\r\n\r\n<p>Idle Duration</p>\r\n\r\n<p>Journey Type</p>\r\n\r\n<p>Distance From the Plant</p>\r\n\r\n<p>Click Here with Hyperlink&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n',1,1),(1257,5,'<p>Check the Idle Time table Location fields</p>\r\n','<p>The idle Time table should be displayed on the Playback Map with the data as follows:</p>\r\n\r\n<p>Location - Location name where the vehicle is Idle for the duration more than 30 Minutes.</p>\r\n\r\n<p>Idle Duration - Total Idle Duration for which the vehicle is idling.&nbsp;</p>\r\n\r\n<p>Journey Type - the type of journey whether its onward or return .</p>\r\n\r\n<p>Distance From the Plant - Distance From the Plant</p>\r\n\r\n<p>Click Here with Hyperlink - The Hyeperlink should be available.</p>\r\n',1,1),(1258,3,'<p>Check the table for Idle Time is&nbsp; dsiplate dor not if teh Idle&nbsp;Duration is &gt; 30 minutes.</p>\r\n','<p>If the Idle Duretion is &gt; 30 minutes then the Table should be displaed in the Play back map</p>\r\n',1,1),(1259,6,'<p>Check the Data format for the ilde time table</p>\r\n','<p>The Idle Time shoudl be displayed in the follwoing format:</p>\r\n\r\n<p><strong>Location</strong> - The Location name shoudl be displayed which is idle for more than 30 minutes</p>\r\n\r\n<p><strong>Idle duration - </strong>The idle duration shoudl be displayed&nbsp; in the HH:MM:SS format only</p>\r\n\r\n<p>Journey Type - the journey type sould be displayed whether its onward or Returnig to the plant</p>\r\n\r\n<p><strong>Distance from the Plant -&nbsp;</strong>the Distance should be displayed and it shoudl be in the KMS format only</p>\r\n\r\n<p><strong>Click here with Hyperlink </strong>-<strong> </strong>the Click here name should be displayed with the hyperlink which will be redirected to the location where the vehcile was idling more than 30 minutes</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Note: </strong>verify the data with the Real Time Report</p>\r\n',1,1),(1260,7,'<p>Check the Hyperlink is working or not</p>\r\n','<p>After clicking on the hyperlink, the popup should eb dispaleyd where vehicle was idling more than 30 minutes along with the following details in the popup</p>\r\n\r\n<p>Lat,long</p>\r\n\r\n<p>date and time</p>\r\n\r\n<p>Location&nbsp;</p>\r\n\r\n<p>Device no</p>\r\n\r\n<p>Speed</p>\r\n\r\n<p>Vehicle no</p>\r\n\r\n<p>Distance from the Plant</p>\r\n',1,1),(1261,8,'<p>Check the data displayed in the popup</p>\r\n','<p>The apporiate data shoul be displayed in the popup as follows:</p>\r\n\r\n<p>Lat Long - for the location where the vehcile was idling</p>\r\n\r\n<p>Date and Time - the time at which the vehicle is idle</p>\r\n\r\n<p>Location - location at which the vehicle is idle</p>\r\n\r\n<p>Device no - The Device no should be displayed of &nbsp;the vehicle</p>\r\n\r\n<p>Speed - the Speed of&nbsp; the vehicle</p>\r\n\r\n<p>vehicle no - the vehicle no should be displayed of the trip for which the playback map is generated</p>\r\n\r\n<p>Distance form the plant: The total distance from the plant shoudl be dispalyed</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Note:&nbsp;</strong>&nbsp;Check the data for he vehicle with the real time report</p>\r\n',1,1),(1262,1,'<p>After successfull login into mobile app, Autoplant QR App page need to display as application name.</p>\r\n','<p><span style=\"color:#000000\">After successfull login into mobile app, Autoplant QR App page should display&nbsp;as application name.</span></p>\r\n',1,1),(1263,2,'<p><span style=\"color:#172b4d\">After QR is scanned, the name &quot;Transit Pass Details&quot; will appear on dashboard header.</span></p>\r\n','<p><span style=\"color:#172b4d\">After QR is scanned, the name &quot;Transit Pass Details&quot; Should appear on dashboard header.</span></p>\r\n',1,1),(1264,3,'<p>To verify that compliance dashboard header need to change as &#39;Autoplant QR/Compliance App.</p>\r\n','<p><span style=\"color:#000000\">Compliance dashboard header should&nbsp;change as &#39;Autoplant QR/Compliance App.</span></p>\r\n',1,1),(1269,1,'<p>Late reported alert as below If&nbsp;vehicle is crossed his TP expiry date.</p>\r\n\r\n<p>&quot;vehicle xxxx &amp; vehicle has reported Delayed at plant at dd/mm/yyyy hh:mm, please take corrective action.&quot;</p>\r\n','<p>If vehicle is crossed his TP expiry date then late reported alerts should be given.</p>\r\n\r\n<p>&quot;vehicle xxxx &amp; vehicle has reported Delayed at plant at dd/mm/yyyy hh:mm, please take corrective action.&quot;</p>\r\n',1,1),(1270,1,'<p>Check the Speed violation report is generating or not</p>\r\n','<p>The speed violation report should be generated</p>\r\n',1,1),(1273,1,'<p>Alert for&nbsp;Vehicle has Speed Values above 45 KM/HR from the IVTS speed violation timstamp as below.</p>\r\n\r\n<p>&quot;Enroute Speed alert - vehicle xxxx &amp; vehicle is running at 45&lt; at Location on dd/mm/yyyy hh:mm, please take corrective action.&quot;</p>\r\n','<p>If Vehicle has Speed Values above 45 KM/HR from the IVTS speed violation timstamp this alerts should be trigger with below SMS format&nbsp;through CT</p>\r\n\r\n<p>&quot;Enroute Speed alert - vehicle xxxx &amp; vehicle is running at 45&lt; at Location on dd/mm/yyyy hh:mm, please take corrective action.&quot;</p>\r\n',1,1),(1276,1,'<p>Idling alert as per below.</p>\r\n\r\n<p>&quot;Idling alerts - vehicle xxxx &amp; vehicle is Idling at Location on dd/mm/yyyy hh:mm, please take corrective action.&quot;</p>\r\n','<p>If vehicle is Idle for 30 mins outside plant and 15 mins inside the plant, then alert should generate.</p>\r\n\r\n<p>&quot;Idling alerts - vehicle xxxx &amp; vehicle is Idling at Location on dd/mm/yyyy hh:mm, please take corrective action.&quot;</p>\r\n',1,1),(1280,2,'<p>Need to verify whether&nbsp;the speed violation is captured for the in plant vehicles or not</p>\r\n','<p>The speed violation should be captured for the inplant vehicles in the sppeed vioaltion report</p>\r\n',1,1),(1281,3,'<p>Need to verify the captured data for&nbsp; the speed vioation for the inplant vehicles&nbsp;</p>\r\n\r\n<p>Verify the data with the Real Time Report</p>\r\n\r\n<p>The data shoudl be captured based on the 3 strings logic</p>\r\n','<p>The all the captured data should be match&nbsp;with the real trime report</p>\r\n',1,1),(1282,1,'<p>If trip will end, below alert will send.</p>\r\n\r\n<p>&quot;Unloading complted of Vehicle xxxx at dd/mm/yyyy hh.mm and ready for next trip&quot;</p>\r\n','<p>If running trips has left the geofenced of plant then respective trip has send in trip report at that time SMS and Email will send to Transporter AOD to Service Engineers with below alert.</p>\r\n\r\n<p>&quot;Unloading complted of Vehicle xxxx at dd/mm/yyyy hh.mm and ready for next trip&quot;</p>\r\n',1,1),(1283,4,'<p>need to verify that whether the alerts were generated fot the speed violation In-Plant</p>\r\n','<p>The speed violation alerts should be generated&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n',1,1),(1286,5,'<p>Check the alert format as follows:</p>\r\n\r\n<p><strong>SPEED VIOALTION IN-PLANT</strong><br />\r\n&quot;In-plant Speed Alerts-vehicle xxxx &amp; vehicle is running at 25&gt; at Location on dd/mm/yyyy hh:mm, please take corrective action.&quot;</p>\r\n','<p>The following format should be displayed&nbsp;for the email alerts</p>\r\n\r\n<p><strong>SPEED VIOALTION IN-PLANT</strong><br />\r\n&quot;In-plant Speed Alerts-vehicle xxxx &amp; vehicle is running at 25&gt;at Location on dd/mm/yyyy hh:mm, please take corrective action.&quot;</p>\r\n',1,1),(1287,1,'<p>Device offline alert will be as per below.</p>\r\n\r\n<p>&quot;Device is offiline and installed In vehicle xxxx&quot;</p>\r\n','<p>On running trip if Device is not communicating to server more than 15 mins alerts should be generated to service engineers&nbsp;</p>\r\n\r\n<p>&quot;Device is offiline and installed In vehicle xxxx&quot;</p>\r\n',1,1),(1288,6,'<p>Check the genertaed alerts data like speed for the vehicle, location,&nbsp; date and time</p>\r\n','<p>The All details / data sh