ort should be generated for the In-Plant</p>\r\n',1,1),(1328,2,'<p>Check the following columns were displayed or not for the speed violation report</p>\r\n\r\n<p>Sr. No.</p>\r\n\r\n<p>Trip id&nbsp;</p>\r\n\r\n<p>Device&nbsp;</p>\r\n\r\n<p>Transporter name</p>\r\n\r\n<p>vehicle</p>\r\n\r\n<p>Transit pass no</p>\r\n\r\n<p>TP Date/time</p>\r\n\r\n<p>Source&nbsp;</p>\r\n\r\n<p>Destination</p>\r\n\r\n<p>Start Time&nbsp;</p>\r\n\r\n<p>End Time</p>\r\n\r\n<p>Speed violation Duration (Hr.min)</p>\r\n\r\n<p>Start Location&nbsp;</p>\r\n\r\n<p>End Location</p>\r\n\r\n<p>Start Speed</p>\r\n\r\n<p>End Speed</p>\r\n\r\n<p>Stage Name&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n','<p>The Following&nbsp;should be displayed in the Speed violation report In-Plant</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Sr. No.</p>\r\n\r\n<p>Trip id&nbsp;</p>\r\n\r\n<p>Device&nbsp;</p>\r\n\r\n<p>Transporter name</p>\r\n\r\n<p>vehicle</p>\r\n\r\n<p>Transit pass no</p>\r\n\r\n<p>TP Date/time</p>\r\n\r\n<p>Source&nbsp;</p>\r\n\r\n<p>Destination</p>\r\n\r\n<p>Start Time&nbsp;</p>\r\n\r\n<p>End Time</p>\r\n\r\n<p>Speed violation Duration (Hr.min)</p>\r\n\r\n<p>Start Location&nbsp;</p>\r\n\r\n<p>End Location</p>\r\n\r\n<p>Start Speed</p>\r\n\r\n<p>End Speed</p>\r\n\r\n<p>Stage Name&nbsp;</p>\r\n',1,1),(1329,3,'<p>Check the appropriate data is displayed or not</p>\r\n','<p>The Appropriate data should be displayed for the speed violation report</p>\r\n\r\n<p>check with the Real Time Report</p>\r\n',1,1),(1330,4,'<p>Check whether the total trip count and monitored trip count displyed or not against the transporter name</p>\r\n','<p>The monitored trips count and total trip count&nbsp;should be displayed against the transporter name</p>\r\n',1,1),(1334,1,'<p>Check whether the Marquee is displayed or not&nbsp;</p>\r\n','<p>The marquee should be dislyed after login on the dashboard</p>\r\n\r\n<p>Example If user login with the abg_central then the Marquee should be displayed on the dashboard</p>\r\n',1,1),(1335,2,'<p>Check whether