 triggered to client on every 3rd of each month containing Plantwise Monthly Report for last month (in excel format) as an attachment.</p>\r\n',1,1),(1591,2,'<p>To verify that Email subject will be Monthly report of (Month Name) for (Plant Name)</p>\r\n','<p>Email subject should be Monthly report of (Month Name) for (Plant Name)</p>\r\n\r\n<p>I.e Considering Email alert for the month of October then email subject should be</p>\r\n\r\n<p>Monthly report of October for MAIHAR</p>\r\n',1,1),(1592,3,'<p>To&nbsp;verify that, in alert we are sending&nbsp;excel file which are containing 5 sheets as per below.</p>\r\n\r\n<p>Sheet 1 - Plant name</p>\r\n\r\n<p>Sheet 2&nbsp;- Trip Report</p>\r\n\r\n<p>Sheet 3&nbsp;- Trip Report Summary</p>\r\n\r\n<p>Sheet 4&nbsp;-&nbsp;MIN MAX Analysis</p>\r\n\r\n<p>Sheet 5&nbsp;- Transporter wise data</p>\r\n','<p>In alert we are sending&nbsp;excel file. That excel file&nbsp;should containing 5 sheets as per below.</p>\r\n\r\n<p>Sheet 1 - Plant name</p>\r\n\r\n<p>Sheet 2&nbsp;- Trip Report</p>\r\n\r\n<p>Sheet 3&nbsp;- Trip Report Summary</p>\r\n\r\n<p>Sheet 4&nbsp;-&nbsp;MIN MAX Analysis</p>\r\n\r\n<p>Sheet 5&nbsp;- Transporter wise data</p>\r\n',1,1),(1593,4,'<p>To verify that in Plant Name sheet&nbsp;will contain a title page</p>\r\n','<p>Plant Name sheet should contain a title of the page as per attached file</p>\r\n',1,1),(1594,5,'<p>To verify that in Trip Report sheet&nbsp;will contain Trip Report data for entire month.</p>\r\n','<p>1. Trip Report sheet should contain Trip Report data for entire month as per attached file.</p>\r\n\r\n<p>I.e For october month, Trip report sheet should contain Trip report data for October month only from 1st October to 31st October.</p>\r\n\r\n<p>2.&nbsp;Trip Report sheet should contain Highlighted Trips having Deviation &gt; 40 Km as per attached file.</p>\r\n',1,1),(1595,6,'<p>To verify that in Trip Report Summary,&nbsp;Pivot will be applied on Trip Report Data</p>\r\n','<p>1. In Trip Report Summary,&nbsp