orter Name, Total no. of trips, hit on target, % of hit on target, Deviation (Above lead, below lead), % of Deviation (Above lead, below lead), Total no of Deviation, % of total deviation, Total no. of non-monitored trips, % of Non-Monitored Trips.</strong></p>\r\n',1,1),(1603,9,'<p>To verify the logic of Deviation in Transporter wise data</p>\r\n','<p>1.&nbsp;<strong>If SAP Lead dist &gt; Onward dist</strong>, then it comes under below lead cases.</p>\r\n\r\n<p>2.&nbsp;<strong>If SAP Lead = 0 for Deviation cases</strong>, then the case should not be considered for deviation bifurcation <strong>(i.e. Above lead and Below lead)</strong>​​​​​​​</p>\r\n',1,1),(1604,10,'<p>To verify the Email body</p>\r\n','<p>Email body should be as per attached file.</p>\r\n\r\n<p>File name : Email Body Content</p>\r\n',1,1),(1607,1,'<p>Check whether the login is working or not&nbsp;</p>\r\n','<p>The user should be able to login with vedanta_rake and the after succefully login the homepage dashboard should be displayed</p>\r\n',1,1),(1608,2,'<p>Check whether the following report dispalyed or not&nbsp; in the report selection tool</p>\r\n\r\n<p>1. Current status report</p>\r\n\r\n<p>2. Trip report</p>\r\n\r\n<p>3. Real Time Report</p>\r\n','<p>The following report should be displayd in the Report selection tool as follows:</p>\r\n\r\n<p>1. Current Status Report</p>\r\n\r\n<p>2. Trip Report&nbsp;</p>\r\n\r\n<p>3. Real Time Report</p>\r\n\r\n<p>&nbsp;</p>\r\n',1,1),(1609,4,'<p>Check whether the follwoing columns were displyed or not in the Current Status Report:</p>\r\n\r\n<ol>\r\n	<li>Trip ID</li>\r\n	<li>Device</li>\r\n	<li>Vehicle</li>\r\n	<li>Transporter&nbsp; Name</li>\r\n	<li>Vehicle Type</li>\r\n	<li>Source Name</li>\r\n	<li>Source Entry Time</li>\r\n	<li>Source Exit</li>\r\n	<li>Source TAT</li>\r\n	<li>Current Location</li>\r\n	<li>Current Date/Time</li>\r\n	<li>Speed</li>\r\n	<li>Vehicle Status</li>\r\n	<li>Distance Travelled</li>\r\n	<li>Idle Since</li>\r\n	<li>Trip Status</li>