ould be displayed</p>\r\n',1,1),(2217,6,'<p>Check whether the vehicle list is displayed or not</p>\r\n','<p>The vehicle list should be displayed for the existng customer and the new customer</p>\r\n',1,1),(2218,2,'<p>To verify that above mentioned stage name need to reflect in report selection tool also</p>\r\n','<p>Above mentioned stage name should reflect in report selection tool.</p>\r\n\r\n<p>Filter should be applicable.</p>\r\n',1,1),(2219,7,'<p>Check whether the all reports were displayed or not in the assign privileges section</p>\r\n','<p>The assign privileges section should ne displayed the all reports for assign to new customer or existing customer</p>\r\n',1,1),(2220,8,'<p>Check whether the mail id is send or not for mentioned mail id while creating the new mail id</p>\r\n','<p>The Welcme mail should be sent to the mentioned mail id after successfull registering the new customer</p>\r\n',1,1),(2221,9,'<p>Check the update button if we skipped to&nbsp;mentioned any mandatory field</p>\r\n','<p>If we skipped to mentioned any mandatory field then it should not process furthur and should displayed the error message as For example - &quot;<strong>Please mention the Mail id&quot;&nbsp;</strong></p>\r\n',1,1),(2222,10,'<p>check whether previousaly creted usenames were displayed or not in the&nbsp;</p>\r\n','<p>The previousaly creted usernames should be displayed</p>\r\n',1,1),(2225,1,'<p>Check whether the emaiil alert genererated or not</p>\r\n','<p>The email alert should be generated for the&nbsp;<strong>New Customer Geofence</strong></p>\r\n',1,1),(2226,2,'<p>Check whether following fields displayed or not</p>\r\n','<p>The following fileds should be disaplyed in the email alert</p>\r\n\r\n<p>Sr no<br />\r\nCompany Name<br />\r\nSource Code<br />\r\nSource Name<br />\r\nDestination Code<br />\r\nDestination Name<br />\r\nRemark</p>\r\n',1,1),(2230,1,'<p>Check whether the alert os generated or not</p>\r\n','<p>The alert should be generated for the</p>\r\n\r\n<p>Updated ETA</p>\r\n',1,1),(2231,2,'<p>Check whether the follwoing fields were displayed or not in the emails alert</p>\r\n','<p>The following fields should be displayed in the email alert:</p>\r\n\r\n<p>Sr no<br />\r\nZone<br />\r\nHub<br />\r\nVehicle no<br />\r\nTCS no<br />\r\nTCS creation date &amp; Time<br />\r\nSource Code<br />\r\nSource Name<br />\r\nSource Exit date &amp; Time<br />\r\nDestination Code<br />\r\nDestination Name<br />\r\nInitial ETA<br />\r\nUpdated ETA<br />\r\nLead Distance<br />\r\nTravelled Distance<br />\r\nLast GPS date &amp; Time<br />\r\nLocation<br />\r\nBattery %</p>\r\n',1,1),(2232,3,'<p>Check the data for the generated email alert</p>\r\n\r\n<p>&nbsp;</p>\r\n','<p>The alert data should be matched with the CSR&nbsp;</p>\r\n',1,1),(2233,1,'<p>We are sending driver nos so To verify that along with driver no we need to send <strong>Level 1</strong> for every alerts.</p>\r\n','<p>Along with driver no we need to send <strong>Level 1</strong> for every alerts.</p>\r\n',1,1),(2236,1,'<p>To verify that&nbsp;an alert need to generate if any new customer (Source/Destination ) code we receive through integration.</p>\r\n','<p>If any new customer (Source/Destination ) code we receive through integration, then alert should trigger</p>\r\n',1,1),(2237,2,'<p>To verify the alert scheduler</p>\r\n','<p>Alert should trigger&nbsp;Daily 10:00 AM</p>\r\n',1,1),(2238,3,'<p>To verify the alert format</p>\r\n','<p>Alert format should be in HTML with below column.</p>\r\n\r\n<p>Sr no<br />\r\nCompany Name<br />\r\nSource Code<br />\r\nSource Name<br />\r\nDestination Code<br />\r\nDestination Name<br />\r\nRemark</p>\r\n',1,1),(2241,1,'<p>Check whether the SMS alerts generated or not</p>\r\n','<p>The alerts should be generated</p>\r\n',1,1),(2242,2,'<p>Check whether the link is working or not i.e. after click on the link it should be redirected to web page which&nbsp;&nbsp;shows the delear location and vehicle location</p>\r\n','<p>The link should be working properly</p>\r\n',1,1),(2243,3,'<p>Check whether the dealer location is dislayed or not</p>\r\n','<p>The dealer locaation should be displayed</p>\r\n',1,1),(2244,4,'<p>Check whether the vehicle is displayed or not</p>\r\n','<p>The Vehicle should be displayed on the map</p>\r\n',1,1),(2247,1,'<p>To verify that&nbsp;Integration clients Working days and Working hours Details column need to be add in&nbsp;Integration UI.</p>\r\n','<p>Integration clients Working days and Working hours Details column should&nbsp;be available in&nbsp;Integration UI.</p>\r\n',1,1),(2250,5,'<p>check the vehicle is displayed or not differently as pe the condition i.e. if vehicle is idle then vehicle color should be Yellow or green if vehicle is in intransit/running</p>\r\n','<p>The different colour should be displayed for the different status of the vehicle</p>\r\n',1,1),(2251,6,'<p>Check whether the vehicle travelled route is displayed or not</p>\r\n','<p>The vehicle travelled route should be displayed from the start location to the current location of the vehicle</p>\r\n',1,1),(2252,1,'<p>To verify that Delivery Violation Report need to be available in report selection tool.</p>\r\n','<p>Delivery Violation Report should&nbsp;be available in report selection tool.</p>\r\n',1,1),(2253,7,'<p>If the trip is closed - Material is deliverd&nbsp;then check whether the dealer location os available or not</p>\r\n','<p>The Dealer location not available message should be displayed for if the trip status is <strong>Trip Closed - Material is delivered</strong></p>\r\n',1,1),(2254,2,'<p>To verify that In Delivery Violation Report, below columns need to add.</p>\r\n\r\n<p>Sr. No.<br />\r\nShip to Party<br />\r\nParty Name<br />\r\nShipment<br />\r\nShipment Date Time<br />\r\nVehicle<br />\r\nIMEI<br />\r\nUnit<br />\r\nTrip Start Time<br />\r\nTrip End Time<br />\r\nTrip TAT<br />\r\nStart Loc<br />\r\nDelivery Lat<br />\r\nDelivery Long<br />\r\nGeofence Hit<br />\r\nMap<br />\r\nDistance</p>\r\n','<p>Below columns should be available in Delivery Violation Report,</p>\r\n\r\n<p>Sr. No.<br />\r\nShip to Party<br />\r\nParty Name<br />\r\nShipment<br />\r\nShipment Date Time<br />\r\nVehicle<br />\r\nIMEI<br />\r\nUnit<br />\r\nTrip Start Time<br />\r\nTrip End Time<br />\r\nTrip TAT<br />\r\nStart Loc<br />\r\nDelivery Lat<br />\r\nDelivery Long<br />\r\nGeofence Hit<br />\r\nMap<br />\r\nDistance</p>\r\n',1,1),(2255,3,'<p>To verify the&nbsp;Delivery Violation Report data with the Trip report</p>\r\n','<p>Delivery Violation Report data should match with Trip report data.</p>\r\n',1,1),(2256,1,'<p>Check whether the Order status report is displayed in reort selection tool and generated or not</p>\r\n','<p>The order status reort should be displayed in the report selection tool and report should be generated for the given date range</p>\r\n',1,1),(2257,2,'<p>Check whether the Innitial ETA and Updated ETA Column is displayed or not</p>\r\n','<p>The Innitial ETA and Updated ETA column should be&nbsp;displpayed in the OSR</p>\r\n',1,1),(2258,3,'<p>Check the logic for the Innitial ETA</p>\r\n','<p>The Innitial ETA should be calculated as follows:</p>\r\n\r\n<p><strong>Plant Exit time&nbsp;+ Lead Distance/Speed gicven for the vehicle</strong></p>\r\n',1,1),(2259,4,'<p>Check the logic for the Updated ETA</p>\r\n','<p>The Updated ETA should be calculated as follows:</p>\r\n\r\n<p>Lead distance - total travelled distance and date-time from the plant exit date-time/avg speed of the vehicle</p>\r\n',1,1),(2262,1,'<p>Check whether the sms alerts were genereted or not for <strong>downloading the EPOD images</strong></p>\r\n','<p>The alert should be gerated for the Downloading the EPOD Images</p>\r\n',1,1),(2263,2,'<p>Check the SMS alert format</p>\r\n','<p>The SMS alert format should be available with the Link&nbsp;</p>\r\n',1,1),(2264,3,'<p>Check whether after clicking on the link the it redirected to the downloading the images or not</p>\r\n','<p>After clicking on the Link the User should be open in the desired browser and redired to downloading the images as follows:</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>Acknowledgement copy</p>\r\n	</li>\r\n	<li>\r\n	<p>Project Site picture</p>\r\n	</li>\r\n	<li>\r\n	<p>Photo Id proof picture of the person on site to whom material was delivered</p>\r\n	</li>\r\n</ol>\r\n',1,1),(2265,4,'<p>Check whether the loaction of the dealer is displayed or not in the sms at where the Delivery was done</p>\r\n','<p>The location name should be displayed in the SMS alert</p>\r\n',1,1),(2266,5,'<p>Check the downloaed images from the URL</p>\r\n','<p>The downlaoed data should be matched with the Daily Summary report data form the portal login&nbsp;</p>\r\n',1,1);
