INSERT INTO `testplans` VALUES (11,1,'<p>User Login to AutoTAT portal functionalities will be tested.</p>\r\n\r\n<p><strong><u>Acceptance Criteria</u></strong></p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>Design should match with Attached template.</p>\r\n	</li>\r\n	<li>\r\n	<p>it should be responsive &amp; light weight</p>\r\n	</li>\r\n	<li>\r\n	<p>it should allow Username</p>\r\n\r\n	<ol>\r\n		<li>\r\n		<p>Username is mandatory field. if it is empty, we should display a message &ldquo;Please provide Username&rdquo;</p>\r\n		</li>\r\n		<li>\r\n		<p>input text should be alphanumeric</p>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n	<li>\r\n	<p>Password field should be enabled once user enters the Username.</p>\r\n\r\n	<ol>\r\n		<li>\r\n		<p>Input is text box and text should be invisible/mask</p>\r\n		</li>\r\n		<li>\r\n		<p>it is mandatory field. if it is empty, we should display a message &ldquo;Please provide password&rdquo;</p>\r\n		</li>\r\n		<li>\r\n		<p>input text should be alphanumeric</p>\r\n		</li>\r\n	</ol>\r\n\r\n	<ol>\r\n		<li>\r\n		<p>it should allow minimum 8 chars</p>\r\n		</li>\r\n		<li>\r\n		<p>it should contain at least 1 numeric</p>\r\n		</li>\r\n		<li>\r\n		<p>it should contain at least 1 special char (&#39;@&#39;, &lsquo;%&#39;, &lsquo;+&rsquo;, &lsquo;\\&rsquo;, &lsquo;/&rsquo;, &lsquo;&rsquo;&#39;, &lsquo;!&rsquo;, &lsquo;#&rsquo;, &lsquo;$&rsquo;, &lsquo;^&rsquo;, &lsquo;?&rsquo;, &lsquo;:&rsquo;, &lsquo;,&rsquo;, &lsquo;&amp;&#39;, &lsquo;*&rsquo;, &lsquo;-&rsquo;, &lsquo;_&rsquo;, &#39;.&rsquo;)</p>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n	<li>\r\n	<p>Login Button should be enabled once you have Username and Password information</p>\r\n	</li>\r\n	<li>\r\n	<p>&ldquo;Can&rsquo;t login?&rdquo; should be redirect to Login - Recovery page and it should open in new tab.</p>\r\n	</li>\r\n	<li>\r\n	<p>&ldquo;Sign-Up for an account&rdquo; should be redirect to Sign-up Page.</p>\r\n	</li>\r\n	<li>\r\n	<p>Avoid using inline Styles</p>\r\n	</li>\r\n</ol>',1,1,1,'c3876d89d171664901e66cbdb07746f1819940c835548bde2d1ae36ceaed4527'),(12,1,'<p>Login recovery for&nbsp;AutoTaT plaftform functionalities will be tested.</p>\r\n\r\n<p><strong><u>Acceptance Criteria</u></strong></p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>Design should match with Attached template.</p>\r\n	</li>\r\n	<li>\r\n	<p>it should be responsive &amp; light weight</p>\r\n	</li>\r\n	<li>\r\n	<p>it should allow Email ID</p>\r\n\r\n	<ol>\r\n		<li>\r\n		<p>Email ID is mandatory field. if it is empty, we should display a message &ldquo;Please provide Email ID&rdquo;</p>\r\n		</li>\r\n		<li>\r\n		<p>input text should be alphanumeric</p>\r\n		</li>\r\n		<li>\r\n		<p>it should allow only Valid Email Id</p>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n	<li>\r\n	<p>&ldquo;Send Recovery Link&rdquo; Button should be enabled once you have Email ID information</p>\r\n	</li>\r\n	<li>\r\n	<p>&ldquo;Return to login?&rdquo; should be redirect to Login page.</p>\r\n	</li>\r\n	<li>\r\n	<p>Avoid using inline Styles</p>\r\n	</li>\r\n</ol>',1,1,1,'bb2fd26ed7850be6db578bef12f4a81fe7c25af7d7e4846700ce3b774061df7d'),(607,1,'<p>Password reset functionalities will be tested.</p>\r\n\r\n<p><strong><u>Acceptance Criteria</u></strong></p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>Design should match with Attached template.</p>\r\n	</li>\r\n	<li>\r\n	<p>it should be responsive &amp; light weight</p>\r\n	</li>\r\n	<li>\r\n	<p>it should allow user to reset the password</p>\r\n	</li>\r\n	<li>\r\n	<p>Password</p>\r\n\r\n	<ol>\r\n		<li>\r\n		<p>Input is text box and text should be invisible/mask</p>\r\n		</li>\r\n		<li>\r\n		<p>it is mandatory field. if it is empty, we should display a message &ldquo;Please provide password&rdquo;</p>\r\n		</li>\r\n		<li>\r\n		<p>input text should be alphanumeric</p>\r\n		</li>\r\n	</ol>\r\n\r\n	<ol>\r\n		<li>\r\n		<p>it should allow minimum 8 chars</p>\r\n		</li>\r\n		<li>\r\n		<p>it should contain at least 1 numeric</p>\r\n		</li>\r\n		<li>\r\n		<p>it should contain at least 1 special char (&#39;@&#39;, &lsquo;%&#39;, &lsquo;+&rsquo;, &lsquo;\\&rsquo;, &lsquo;/&rsquo;, &lsquo;&rsquo;&#39;, &lsquo;!&rsquo;, &lsquo;#&rsquo;, &lsquo;$&rsquo;, &lsquo;^&rsquo;, &lsquo;?&rsquo;, &lsquo;:&rsquo;, &lsquo;,&rsquo;, &lsquo;&amp;&#39;, &lsquo;*&rsquo;, &lsquo;-&rsquo;, &lsquo;_&rsquo;, &#39;.&rsquo;)</p>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n	<li>\r\n	<p>Confirm Password</p>\r\n\r\n	<ol>\r\n		<li>\r\n		<p>it should match the text which is enter in previous field</p>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n	<li>\r\n	<p>Reset Password</p>\r\n\r\n	<ol>\r\n		<li>\r\n		<p>this button should be enabled only both passwords are matching</p>\r\n		</li>\r\n		<li>\r\n		<p>after the password strength validation, it should reset the password and allow user to Login with new password.</p>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n	<li>\r\n	<p>Avoid using inline Styles</p>\r\n	</li>\r\n</ol>',1,1,1,'202dc9e78257eef702bd34a4f8ac60ab5b7f19f4f4a2530b9b1e4f0dd116b381'),(608,1,'<p>Functionalities of adding a new user to the system will be tested.</p>\r\n\r\n<p><strong><u>Acceptance Criteria</u></strong></p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>Design should match with Attached template.</p>\r\n	</li>\r\n	<li>\r\n	<p>it should be responsive &amp; light weight</p>\r\n	</li>\r\n	<li>\r\n	<p>Need to collect below fields</p>\r\n\r\n	<ol>\r\n		<li>\r\n		<p>First Name</p>\r\n\r\n		<ol>\r\n			<li>\r\n			<p>Mandatory Field</p>\r\n			</li>\r\n			<li>\r\n			<p>Text Box - allow only Charters</p>\r\n			</li>\r\n		</ol>\r\n		</li>\r\n		<li>\r\n		<p>Last Name</p>\r\n\r\n		<ol>\r\n			<li>\r\n			<p>Mandatory Field</p>\r\n			</li>\r\n			<li>\r\n			<p>Text Box - allow only Charters</p>\r\n			</li>\r\n		</ol>\r\n		</li>\r\n		<li>\r\n		<p>Email Address</p>\r\n\r\n		<ol>\r\n			<li>\r\n			<p>Mandatory Field</p>\r\n			</li>\r\n			<li>\r\n			<p>Text Box - Email Address format</p>\r\n			</li>\r\n		</ol>\r\n		</li>\r\n		<li>\r\n		<p>Mobile Number</p>\r\n\r\n		<ol>\r\n			<li>\r\n			<p>Mandatory Field</p>\r\n			</li>\r\n			<li>\r\n			<p>Text Box - allow only Numbers (10 digit) without Country code;</p>\r\n			</li>\r\n			<li>\r\n			<p>They can enter number with Spaces/&rdquo;-&rdquo;</p>\r\n			</li>\r\n		</ol>\r\n		</li>\r\n		<li>\r\n		<p>Company</p>\r\n\r\n		<ol>\r\n			<li>\r\n			<p>Mandatory Field</p>\r\n			</li>\r\n			<li>\r\n			<p>List Box - Values should be populated from Company filed</p>\r\n			</li>\r\n		</ol>\r\n		</li>\r\n		<li>\r\n		<p>Password</p>\r\n\r\n		<ol>\r\n			<li>\r\n			<p>Mandatory Field</p>\r\n			</li>\r\n			<li>\r\n			<p>Input is text box and text should be invisible/mask</p>\r\n			</li>\r\n			<li>\r\n			<p>input text should be alphanumeric</p>\r\n			</li>\r\n		</ol>\r\n\r\n		<ol>\r\n			<li>\r\n			<p>it should allow minimum 8 chars</p>\r\n			</li>\r\n			<li>\r\n			<p>it should contain at least 1 numeric</p>\r\n			</li>\r\n			<li>\r\n			<p>it should contain at least 1 special char (!,@,#,$,^)</p>\r\n			</li>\r\n		</ol>\r\n		</li>\r\n		<li>\r\n		<p>Confirm Password</p>\r\n\r\n		<ol>\r\n			<li>\r\n			<p>Mandatory Field</p>\r\n			</li>\r\n			<li>\r\n			<p>Input is text box and text should be invisible/mask</p>\r\n			</li>\r\n			<li>\r\n			<p>input text should be matched with Password field</p>\r\n			</li>\r\n		</ol>\r\n		</li>\r\n		<li>\r\n		<p>User Role</p>\r\n\r\n		<ol>\r\n			<li>\r\n			<p>Mandatory Field</p>\r\n			</li>\r\n			<li>\r\n			<p>List Box - Values should be populated from User Roles table</p>\r\n			</li>\r\n		</ol>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n	<li>\r\n	<p>Add User</p>\r\n\r\n	<ol>\r\n		<li>\r\n		<p>Button</p>\r\n		</li>\r\n		<li>\r\n		<p>it should be enabled only all mandatory fields are filled</p>\r\n		</li>\r\n		<li>\r\n		<p>After successful addition, user will be redirect to List Users page with Success message</p>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n</ol>',1,1,1,'99766bf2f53216f4d580b57e394da0524f3d9f8bbf61921b97644c3d3f284e76'),(609,1,'<p>Functionalities of editing a user to the system will be tested</p>\r\n\r\n<p><strong><u>Acceptance Criteria</u></strong></p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>Design should match with Attached template.</p>\r\n	</li>\r\n	<li>\r\n	<p>It should be responsive &amp; light weight</p>\r\n	</li>\r\n	<li>\r\n	<p>Below fields should display but not editable</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>a. User Name</p>\r\n\r\n<p>b. Company</p>\r\n\r\n<p>c. User Statistics</p>\r\n\r\n<p>i. Created Date - DD/MM/YYY HH:MM AM/PM</p>\r\n\r\n<p>ii. Last Active - DD/MM/YYY HH:MM AM/PM</p>\r\n\r\n<p>iii. Last Modified - DD/MM/YYY HH:MM AM/PM</p>\r\n\r\n<p>4. Below fields should be editable</p>\r\n\r\n<p>a. Email Address</p>\r\n\r\n<p>i. Mandatory Field</p>\r\n\r\n<p>ii. Text Box - Email Address format</p>\r\n\r\n<p>b. Mobile Number</p>\r\n\r\n<p>i. Mandatory Field</p>\r\n\r\n<p>ii. Text Box - allow only Numbers (10 digit) without Country code;</p>\r\n\r\n<p>iii. They can enter number with Spaces/&rdquo;-&rdquo;</p>\r\n\r\n<p>5. Activate / Deactivate dropdown should be displayed - editable</p>\r\n\r\n<p>6. Assigned Roles</p>\r\n\r\n<p>a. List the existing roles.</p>\r\n\r\n<p>b. On clicking &ldquo;x&rdquo; icon under Action should allow user to delete existing roles.</p>\r\n\r\n<p>c. On clicking &ldquo;Add Role&rdquo; button should display a popup with list of roles available to map with user</p>\r\n\r\n<p>7. Edit User</p>\r\n\r\n<p>a. Button</p>\r\n\r\n<p>b. it should be enabled only all mandatory fields are filled</p>\r\n\r\n<p>c. After successful update, user will remain on same Edit page</p>',1,1,1,'9d0338f8edcf984cf3a24d6ad25180f4baae6b5e211c33049a3bca0fa2d6ca76'),(610,1,'<p>List user page functionalities will be tested.</p>\r\n\r\n<p><strong><u>Acceptance Criteria</u></strong></p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>Design should match with Attached template.</p>\r\n	</li>\r\n	<li>\r\n	<p>it should be responsive &amp; light weight</p>\r\n	</li>\r\n	<li>\r\n	<p>List of users of the system should be displayed with below field&rsquo;s data</p>\r\n\r\n	<ol>\r\n		<li>\r\n		<p>Name - (First Name and Last Name)</p>\r\n		</li>\r\n		<li>\r\n		<p>User Role - Only if User is a site admin</p>\r\n		</li>\r\n		<li>\r\n		<p>Company</p>\r\n		</li>\r\n		<li>\r\n		<p>EmailId</p>\r\n		</li>\r\n		<li>\r\n		<p>Last Active - Latest login session date/time should be displayed</p>\r\n		</li>\r\n		<li>\r\n		<p>Status - Admin should be able to set user status to Active or Deactive.</p>\r\n		</li>\r\n		<li>\r\n		<p>Action</p>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n</ol>\r\n\r\n<p>i. On clicking edit icon, user should be redirected to Edit User screen.</p>\r\n\r\n<p>ii. On clicking &#39;X&#39; icon, Admin should be able to set user status to Active or Deactive.</p>\r\n\r\n<p>4. Add User - On clicking button, user should be redirected to Add User screen.</p>\r\n\r\n<p>5. Search - User should be able to search users based on the given below criteria</p>\r\n\r\n<p>a. Name</p>\r\n\r\n<p>b. User Role</p>\r\n\r\n<p>c. Email Address</p>\r\n\r\n<p>d. Company</p>\r\n\r\n<p>6. User type filter</p>\r\n\r\n<p>a. All Users</p>\r\n\r\n<p>b. Active Users - By default Active Users will be filtered out</p>\r\n\r\n<p>c. Deactive Users</p>',1,1,1,'fc9d82cd20c7857031043d48c0ef0b3466f804a41544c4c889405bd9de9a285b'),(935,1,'',1,1,1,'8f02d8ed06b415771d4f3927fcae27352e953e4d486d9bea9433cec871c1ef24'),(936,1,'<p>UI Design Check for below screens:</p>\r\n\r\n<p>- Sim Configuration</p>\r\n\r\n<p>- Add Device</p>\r\n\r\n<p>- Device Inventory Report</p>\r\n\r\n<p>-View Device</p>\r\n\r\n<p>&nbsp;</p>',1,1,1,'22c1d21447f8c8e9f47eb434d3b00763609279b8a28a6263e91a1137c1726d4c'),(961,954,'<p>Need to test all the fuctinality of IVTS web applicaiton&nbsp;</p>\r\n\r\n<p>1. URL access ivts.noviretechnologies.com</p>\r\n\r\n<p>2. Login and password functionality</p>\r\n\r\n<p>3. Home Dasboard verificaiton and MAP view&nbsp;</p>\r\n\r\n<p>4. Customeized repors has to execute as per the requirements and logics&nbsp;</p>\r\n\r\n<p>5. Reports to be download&nbsp;</p>',1,1,1,'6ae795c034062714c47d76eba568d9cb81e961567891cf607934bfa8f8da640f'),(995,954,'<p>Give the ability to check order status and confirm delivery to End Customers. These end customers can be dealers, warehouses, storage depots, and actual final customers.</p>\r\n\r\n<p>The data sources can be received from varied solutions and need not only be Autoplant/Novire solutions. The problem to overcome here is to track the incoming data. This data will be updated at various stages. Making sure that the customer has a smooth experience viewing this data is key.</p>',1,1,1,'d5a2ec2cefcb0208948b8bc4ef5252e11f94240f68d0b67f14b6819c0e6c35f4'),(1752,1,'<p>To validate Device signal receiver and Enricher</p>',1,1,0,'2601bbd4adfaf92b88abc1f5c4767a120842e87f2cf3adfc120adedadff6a05b');
