INSERT INTO `testsuites` VALUES (128,'<p>Set of UI Test Cases for User Login.</p>\n'),(161,'<p>Set of UI testcases for Login Recovery.</p>\n'),(260,'<p>Set of UI testcases for&nbsp;passsword reset.</p>\n'),(326,'<p>Set of List Users UI testcases.</p>\n'),(370,'<p>Set of Add User UI test cases</p>\n'),(489,'<p>Set of Edit User UI testcases</p>\n'),(557,'<p>Set of test cases for UI sim configuration functionalities.</p>\n'),(604,'<p>Set of testcases for Device inventory UI functionalities</p>\n'),(605,'<p>Set of test cases for UI Add Device screen functionalities</p>\n\n<p>&nbsp;</p>\n'),(606,'<p>Set of test cases for View Device UI functionalities.</p>\n'),(962,'<p>Test suit contains the test cases of All Sprints</p>\r\n\r\n<p>&nbsp;</p>\r\n'),(997,'<p>Test cases of 4th Sprint</p>\r\n'),(1134,'<p>We need to test the EPOD mobile applicaiton in step by step process of each stage.&nbsp;It has integrated with VC and inplant webapplicaiton and we need to cross verified the trancations with them.&nbsp;</p>\r\n\r\n<p>The test suite cotains test cases of mobile epod as per the process.&nbsp;</p>\r\n\r\n<p>&nbsp;Work flow need to test</p>\r\n\r\n<p>1. Order puch</p>\r\n\r\n<p>2. Truck allowcated</p>\r\n\r\n<p>3. DO created</p>\r\n\r\n<p>4. Gate Entry</p>\r\n\r\n<p>5. Invoice Generated</p>\r\n\r\n<p>6. Enroute</p>\r\n\r\n<p>7. Customer Entry</p>\r\n\r\n<p>8. Custoemr exit<br />\r\n&nbsp;</p>\r\n'),(1206,''),(1296,'<p>Set of UI Test Cases for Sim Inventory Report</p>\r\n'),(1331,''),(1444,''),(1507,''),(1508,''),(1627,''),(1652,''),(1753,'<p>Set of testcases for validating signal receiver and enricher</p>\r\n'),(1931,''),(2099,''),(2158,''),(2159,'');
/*!40000 ALTER TABLE `testsuites` ENABLE KEYS */;
UNLOCK TABLES;

